            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴨо ʍоᴇй ʍиᴧоᴄᴛи ᴛы ᴇщᴇ ᴦоʙоᴩиɯь, ᴨо ʍоᴇй ᴨᴩихоᴛи ᴛы ᴄᴛоиɯь нᴀ ᴋоᴧᴇнях, ᴨо ʍоᴇʍу ᴨᴩиᴋᴀзу ᴛы ᴄᴨᴩыᴦнᴇɯь ᴄ ᴋᴩыɯи!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌я нᴀучу ᴛᴇбя ᴋун-ɸу, ᴨᴩоᴄᴛо ʙыᴩубᴧю ᴛᴇбя ᴄ ʙᴇᴩᴛуɯᴋи.⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛы ᴨᴩоᴄᴛо ʍуᴛнᴀя ᴄубᴄᴛᴀнция инь, ᴋоᴛоᴩᴀя ᴨᴩиᴛʙоᴩяᴇᴛᴄя ʙ зᴇʍᴧᴇ!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛы ᴄᴛᴩᴀдᴀᴇɯь ᴄиндᴩоʍоʍ ᴨᴄихичᴇᴄᴋоᴦо ᴀʙᴛоʍᴀᴛизʍᴀ, ᴨᴩоᴄᴛо у ᴛᴇбя ᴋᴀᴋиᴇ ᴛо ᴨᴄᴇʙдоᴦоᴧюцинᴀции, и ᴛы нᴇᴄᴇɯь бᴩᴇд!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴇᴄᴧи ᴛы дуʍᴀᴇɯь чᴛо я ᴦоʙоᴩю ᴛʙоиʍи ᴄᴧоʙᴀʍи, ᴛо у ᴛᴇбя идиᴀᴛоᴩный ᴀʙᴛоʍᴀᴛизʍ.⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴄᴇйчᴀᴄ я нᴇ ᴄᴧыɯᴀᴧ ᴩᴀᴄᴄуждᴇний, ᴩᴀзʍыɯᴧᴇний, я нᴇ ᴄᴧыɯᴀᴧ ᴧоᴦиᴋи ʙ ᴛʙоих ᴄᴧоʙᴀх, ᴧибо у ʍᴇня нᴀуɯниᴋи ᴨᴧохиᴇ, ᴧибо ᴛы ᴛуᴨой!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛо чᴛо ᴛы ᴦᴇй ϶ᴛо ᴀᴋᴄиоʍᴀ, ᴀ ᴀᴋᴄиоʍᴀ ʙ доᴋᴀзᴀᴛᴇᴧьᴄᴛʙᴇ нᴇ нуждᴀᴇᴛᴄя!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ʙᴄᴇ чᴛо ᴛы ᴦоʙоᴩиɯь ϶ᴛо ᴄоɸизʍ, ᴛо ᴇᴄᴛь ᴨᴩᴇднᴀʍᴇᴩᴇнноᴇ, ᴄознᴀᴛᴇᴧьноᴇ нᴀᴩуɯᴇниᴇ ᴨᴩᴀʙиᴧ ᴧоᴦиᴋи!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴋᴀждᴀя ᴄᴧожнᴀя ᴄубᴄᴛᴀнция ᴄоᴄᴛоиᴛ из ᴨᴩоᴄᴛых чᴀᴄᴛᴇй — нᴇ ᴄущᴇᴄᴛʙуᴇᴛ ничᴇᴦо ᴨᴩоᴄᴛоᴦо.⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛʙои ᴄᴧоʙᴀ ᴀнᴛиноʍия, ᴛы ᴨᴩоᴛиʙоᴩᴇчиɯ ᴄᴀʍоʍу ᴄᴇбᴇ!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴨᴩᴇдуᴨᴩᴇждᴀй ᴋоᴦдᴀ зᴀдᴀᴇɯь ʙоᴨᴩоᴄ, ᴨᴩоᴄᴛо нᴇᴧьзя ᴩᴀзᴧичиᴛь ᴛо ᴋоᴦдᴀ ᴛы нᴇᴄᴇɯь ᴄʙой бᴩᴇд и ᴛо ᴋоᴦдᴀ зᴀдᴀᴇɯь ᴄᴛоющий ʙоᴨᴩоᴄ!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌нᴇ будь ᴦᴀʙноʍ, ʙᴇди ᴄᴇбя ᴨодобᴀющᴇ!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌я ᴛᴇбя оᴋуᴨиᴩоʙᴀᴧ, ᴋᴀᴋ ᴄоʙᴇᴛᴄᴋиᴇ ʙойᴄᴋᴀ бᴇᴩᴧин ʙ 45!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌нᴀɯᴀ ʍᴀɯᴀ ᴦᴩоʍᴋо ᴨᴧᴀчᴇᴛ.⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌я нᴀучу ᴛᴇбя ᴇбᴀᴛьᴄя, и ᴇбᴀᴛь я буду ᴛʙою дᴀʍу.⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛᴇбя ᴧюбяᴛ чуᴩᴋи, ᴨоᴛоʍу чᴛо ᴛы ᴧоɯᴀдь, ᴀ чуᴩᴋи ᴧюбяᴛ ᴇбᴀᴛь ᴧоɯᴀдᴇй!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌я ᴄ ᴛобой иᴦᴩᴀю, ᴋᴀᴋ ᴛиᴦᴩ ᴄ добычᴇй.⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴋᴀᴋ ʙᴀʍᴨиᴩ боиᴛᴄя ᴄʙᴇᴛᴀ, ᴛᴀᴋ ᴛы боиɯьᴄя ʍоих ᴄᴧоʙ.⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌я нᴇ хочу будиᴛь ʙ ᴛᴇбᴇ зʙᴇᴩя, я нᴇ хочу ᴄᴧыɯᴀᴛь ᴋᴀᴋ ᴛы ᴋуᴋᴀᴩᴇᴋᴀᴇɯь!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛы издᴀᴇɯь зʙуᴋи ᴨохожиᴇ нᴀ оᴩᴦᴀзʍ бᴀбочᴋи!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛы нᴇʍощнᴀя ɯᴀʙᴋᴀ ᴄо ᴄᴧоʍᴀнной ноᴦой.⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛы ᴛоᴧьᴋо чᴛо ᴨᴩизнᴀᴧᴄя ʍнᴇ ʙ ᴧюбʙи.⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌я ʙᴀᴄ нᴀᴨᴩюʙᴧю ᴨо ᴩуᴄᴧу, уᴇбу ᴨо ᴦоᴩᴧу ʙᴇᴄᴧоʍ.⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛы ᴦᴩуᴄᴛнᴀя ᴋуᴩᴛизᴀнᴋᴀ, нᴀʙязыʙᴀющᴀя ᴄʙоᴇ ʍнᴇниᴇ оᴋᴩужᴀющиʍ, ᴀ оᴋᴩужᴀющиᴇ ᴨᴩоᴄᴛо ᴨоᴄыᴧᴀюᴛ ᴛᴇбя ʙ знᴀᴋоʍоᴇ ᴛᴇбᴇ ʍᴇᴄᴛо!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛᴇбя ʍᴀᴛь нᴀ ᴨоʍойᴋᴇ нᴀɯᴧᴀ ᴋоᴦдᴀ ᴛᴇбя ᴨᴄины ᴨо ᴋᴩуᴦу ᴨуᴄᴋᴀᴧи)⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛʙой ᴄᴧиʙ дᴧя ʍᴇня нᴇ ноʙоᴄᴛь⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛы нᴇдоʍᴇᴩоᴋ, ᴨоᴄᴋоᴧьᴋу нᴇ ʍожᴇɯь изʍᴇᴩиᴛь ʍᴇᴩу ᴄʙоᴇй ᴄᴛоиʍоᴄᴛи, ᴀ онᴀ ᴩᴀʙнᴀ нуᴧю.⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛы боиɯьᴄя иᴄᴨоᴧьзоʙᴀᴛь ᴄʙой языᴋ ᴨо ᴨᴩяʍоʍу нᴀзнᴀчᴇнию, ᴀ ʙᴄᴇ ᴨоᴛоʍу чᴛо ᴛы ᴨᴩиʙыᴋ ᴧизᴀᴛь чужиᴇ чᴧᴇны.⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛᴩᴀнᴄɸоᴩʍиᴩуйᴄя из обᴇзяны ʙ ɯᴀʙᴋу, ᴄʍыᴄᴧᴀ ᴛуᴛ нᴇᴛ, ᴨᴩоᴄᴛо ᴨᴩиᴋоᴧьно!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
            "⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌ᴛʙой ʍозᴦ ᴨохожь нᴀ ᴋᴀɯу, ᴛо ᴇᴄᴛь ᴛᴩᴀʙы и ʙоды ʍноᴦо, ᴀ оᴋᴀзыʙᴀᴇᴛᴄя ᴨоᴛоʍ ʙᴄᴇ ʙ ᴛуᴀᴧᴇᴛᴇ!⋋🩸 | ⛓️ |🩸 | ⛓️ |🩸🔱🩸 | ⛓️ |🩸 | ⛓️ |🩸⋌",
